nd functional. This collection is created to empower \ud83d\ude4f it\u2019s the everyday wear that you won\u2019t want to take off \ud83d\udd25\ud83d\udc40\n\nCrafted from Certified EU eco label TENCEL\u2122 fabric made using sustainable wood pulp \u267b\ufe0f\ud83c\udf0d using a closed loop production process. TENCEL\u2122 is the perfect functional fabric for our essential range \ud83d\ude4c not only is it super soft on the skin, has enhanced breathability certified as biodegradable and compostable \u267b\ufe0f, moisture wicking and antibacterial \ud83d\udc99\ud83d\ude4f\n\nAnd that\u2019s not all. For the first 100 orders in our new Essentials range, we will be sending you a unique code to plant your very own tree with @treedom_trees \ud83d\udc99\ud83c\udf0d Not only will you be investing in quality pieces that don\u2019t cause excess harm to the planet but you will be cutting down your carbon footprint \u267b\ufe0f A double win for you and the planet \ud83e\udd70\ud83d\udc99\ud83c\udf0d\n\nCheck out our stories for a breakdown of each style! Available to pre order now. Please see our website for pre order time frames \ud83d\ude4f\n\n\ud83d\udcf7: @rebecca.munroe with @preciousagram, @catmeffan, @emilylaceyx, @jessicaroselambregts, @asha.modha, @georgiaglobe, @joycelynevacupidphillips, @being_just_us, @micheleronson \ud83d\udc99"}}]},"edge_media_to_comment":{"count":76},"comments_disabled":false,"taken_at_timestamp":1612691951,"edge_liked_by":{"count":1038},"edge_media_preview_like":{"count":1038},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.1225.3154.3154a/s640x640/146371432_324675702280362_758529712562286178_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=o4RXT9kTJ6EAX9JfK_k\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=20047a66e0b68c2f7cb181107646a337\u0026oe=6070B870\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/ s":[{"node":{"text":"*closed* We want you guys \ud83c\udf0d\ud83d\udc4b It\u2019s that time again, when we first launched Stay Wild we knew we wanted you guys to model our pieces for us....which is why we did an open casting call on Instagram \ud83d\udcf7\ud83d\ude4c we have done it for every shoot and we have adored meeting you guys and shooting with you all \ud83d\udc99 Shoots are our favourite things to do and they are always very chilled and a lot of fun \ud83d\ude0d plus you get to hang with us @natalieglaze and @zannavandijk \ud83d\udc83\ud83d\udc83\ud83d\ude4c\ud83d\ude4cSo due to the success of last year it\u2019s time to do it again \ud83c\udf0a\ud83c\udf0a\ud83c\udf0a\nOpen casting call \ud83d\udc49 We need some new models to feature in our upcoming shoots (we have a few lined up \ud83d\udc40) \ud83c\udf0dWe want to represent every woman, every shape, size and age. So if you would feel confident wearing our pieces on camera then please get in touch or tag a friend below in the comment who you think would be keen or do a great job \ud83d\udc4b\ud83d\ude4c\nHow to apply \ud83d\udc47\nDrop us an email on casting@staywildswim.com with the title \u201cModel Casting Call\u201d\n\ud83d\udc49Please include a brief intro about yourself, your location, your dress size, chest size, a head shot and a full length photo \ud83d\udcf8 Please only apply if you are aged 18 or over and can get to London for the shoot ok \ud83d\ude4f\n\ud83d\udc49Please note, the shoot dates aren\u2019t set yet and there will be a few over the next few months \ud83d\ude4cbut we wanted to start with our casting calls so we have some of you amazing women lined up for them. Also we get hundreds of applications so means we have time to go through them all properly\ud83d\udc99\n\ud83d\udc49 We will only be accepting email applications so please don\u2019t apply through our DMs as we would hate to miss them \ud83d\ude4f\n\ud83d\udc49Food and expenses covered \ud83d\ude4fof course as always we are eternally grateful for the donation of your time to represent a brand which is a force for change and would love you guys to be part of our journey \ud83d\udc99Excited for the next year of shoots and Stay Wild Women \ud83c\udf0d#beaforceofnature #staywild #modelsearch"}}]},"edge_media_to_comment":{"count":125},"comments_disabled":false,"taken_at_timestamp":1580058342,"edge_liked_by":{"count":1313},"edge_media_preview_like":{"count":1313},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.280.720.720a/s640x640/81303297_2707063846039001_4161625584696413725_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=sX9FlCbjfBcAX8P0n8H\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=f156be6f8439fa52e5d5003a27f3c8c3\u0026oe=6071246B\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p150x150/81303297_2707063846039001_4161625584696413725_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=sX9FlCbjfBcAX8P0n8H\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=ffe85a35588367b59cc29d7d15309780\u0026oe=6071014B\u0026_nc_sid=7bff83","config_width":150,"config_height":266},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p240x240/81303297_2707063846039001_4161625584696413725_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=sX9FlCbjfBcAX8P0n8H\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=8e626aa7940fe03b3abaf71aa4521ac1\u0026oe=6070FB8D\u0026_nc_sid=7bff83","config_width":240,"config_height":426},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p320x320/81303297_2707063846039001_4161625584696413725_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=sX9FlCbjfBcAX8P0n8H\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=0986b42e2bfabf75c402be780125c597\u0026oe=6070EB33\u0026_nc_sid=7bff83","config_width":320,"config_height":568},{"src":" d83d\udcf8: @emhanney wearing the coral nomad shot by @jonoallenphotography"}}]},"edge_media_to_comment":{"count":8},"comments_disabled":false,"taken_at_timestamp":1617780956,"edge_liked_by":{"count":516},"edge_media_preview_like":{"count":516},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c192.0.640.640a/169956527_931183187699850_9067231786194440880_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=LNpFEZPa9BYAX_V9xcl\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=6adfc3e33ede916a6bbd3bb66183ad8f\u0026oe=6094427C\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c192.0.640.640a/s150x150/169956527_931183187699850_9067231786194440880_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=LNpFEZPa9BYAX_V9xcl\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=e6dc812730bafae9d20a1ac2506516e5\u0026oe=60943C9C\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c192.0.640.640a/s240x240/169956527_931183187699850_9067231786194440880_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=LNpFEZPa9BYAX_V9xcl\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=64d077be8e0ef809e0badfcc8e3a1538\u0026oe=6092655E\u0026_nc_sid=7bff83","config_width":240,"config_height":240},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c192.0.640.640a/s320x320/169956527_931183187699850_9067231786194440880_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=LNpFEZPa9BYAX_V9xcl\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=90da2136536ebfffd01181aa4204e06d\u0026oe=6094E824\u0026_nc_sid=7bff83","config_width":320,"config_height":320},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c192.0.640.640a/s480x480/169956527_931183187699850_9067231786194440880_n.jpg?tp=1\u0026_nc_ht=instagram.fe hter and warmer days are fast approaching \ud83d\udc40\u2600\ufe0f which means it's time to start thinking about revisiting that Summer wardrobe \ud83d\ude4f When looking to invest in new clothes, and when buying second hand isn\u2019t an option, it\u2019s good to arm yourself with the facts about which materials to go for. As some materials are better for the planet than others \u267b\ufe0f\ud83c\udf0d Here are a few of our favourites and why...\n\nStarting off with the incredible ECONYL\u00ae fabric that we make our beautiful swimwear from \ud83e\udd70 It's created from unwanted waste from around the world, such as fishing nets pulled from the ocean, fabric scraps left over from industry and industrial plastic from landfill and oceans \ud83c\udf0a\ud83c\udf0d\u267b\ufe0f\n\nNext up we have TENCEL\u2122 fabric which is the newest material to be used in our Essentials collection \ud83d\udc99 Derived from nature, TENCEL\u2122 is a functional fabric that is cool to touch, has enhanced breathability and is certified as biodegradable and compostable \u267b\ufe0f\ud83d\ude4c\n\nWe use Oeko-Tex\u00ae\ufe0f certified organic linen for our Lana shirt as it is a low impact, naturally biodegradable and recyclable material \ud83d\udc40\u267b\ufe0f It\u2019s breathable and highly absorbent, making it perfect to be worn over your swimwear or on a warm Summer\u2019s day \ud83d\udd25\ud83e\udd70\ud83d\ude4c\n\nAnother favourite of ours is ECOVERO\u2122 \ud83d\ude0d\ud83d\ude4f Not only is it soft to touch and derived from renewable resources, but it also have a significantly lower impact on the planet as the manufacturing of the ECOVERO\u2122 fibers generates up to 50% lower emissions and water impact compared to generic Viscose \ud83c\udf0d\u267b\ufe0f\ud83d\udc4f\n\nWhat\u2019s your favourite sustainable materials? \n\n\ud83d\udcf8: @meganhemsworth"}}]},"edge_media_to_comment":{"count":4},"comments_disabled":false,"taken_at_timestamp":1616503940,"edge_liked_by":{"count":463},"ed video":false,"accessibility_caption":"Photo by Stay Wild\u00ae on March 18, 2021. May be an image of outdoors.","edge_media_to_caption":{"edges":[{"node":{"text":"Today is #GlobalRecyclingDay and we wanted to remind you guys about our Circularity Project \u267b\ufe0f\ud83c\udf0f we launched it last November to help keep precious textiles out of landfill and back into circulation \ud83d\ude4f For this we are accepting any of your broken and unwearable swimwear (from ANY brand!) and alongside our factory we send them on to be recycled and repurposed into eco-industrial products \ud83d\udc99 It's not the end solution but it is a step in the right direction and keeping textiles out of landfill. And as a thank you for getting involved and cutting down your waste, we will be sending you a 10% discount code to use on the Stay Wild website \ud83d\udc40\ud83d\udc99\ud83c\udf89 - just send us a photo of your postage receipt via DMs to receive your code \n\nRecycling is one of the easy steps everyone can take to help to reduce their carbon emissions in the fight against climate change \ud83d\ude4c This #GlobalRecyclingDay The British government @beisgovuk have chosen to showcase Stay Wild and our Circularity Project as one of the recycling initiatives that are helping clean up the planet and creating a greener Britain \u267b\ufe0f\ud83c\udf0f\ud83d\udc99\n\nSo why is this so important \ud83d\udc49 In the UK alone, an estimated 350,000 tonnes of used but still wearable clothing goes to landfill every year. And these textiles that do end up in landfill can sit there for up to 200 years decomposing and emitting greenhouse gases, leading to global warming. With shocking statistics like these, it's clear that it is not enough to be a bystander anymore \ud83d\udc40 We all have to actively do our part in the global fight against climate change. With so many simple and easy small swaps out there, we can all make small changes in our lives to live a little more sustainably \ud83d\ude4f
